import React, { Component } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  background-image: url('https://images.pexels.com/photos/1036857/pexels-photo-1036857.jpeg?auto=compress&cs=tinysrgb&dpr=3&h=750&w=1260');
  /* background-color: red; */
  /* background-size: cover; */
`;

class Home extends Component {
  render() {
    return (
      <Container>
        <p>
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. Error fuga
          dolor fugiat, at corporis delectus reprehenderit suscipit doloremque
          facilis officiis nihil dignissimos commodi temporibus magni
          accusantium. Id ratione sequi quos!
        </p>
      </Container>
    );
  }
}

export default Home;
